    # test invariant
    def test_invariant(self):
        for i in range(1,3999):
            r = int_to_roman(i)
            j = roman_to_int(r)
            assert i == j

    # test if everything works properly with numpy dtypes
    @pytest.mark.parametrize('dtype', ['uint8', 'uint16', 
                                       'uint32', 'uint64', 
                                       'int8', 'int16',
                                       'int32', 'int64'])

    # test that numpy arrays with integral
    # dtype work properly
    def test_invariant_numpy(self, dtype):

        dtype = numpy.dtype(dtype)
        max_value = min(numpy.iinfo(dtype).max, 3999)
        values = numpy.arange(1, max_value + 1, dtype=dtype)

        for i,i_np in zip(range(1, max_value + 1), values):
            r = int_to_roman(i_np)
            j = roman_to_int(r)
            assert i == j

    # in python bool is subclass of int,
    # therefore valid input
    def test_bool_input(self):

        assert int_to_roman(True) == 'I'
        with pytest.raises(ValueError):
            assert int_to_roman(False)

    # input of correct type but wrong
    # range should raise ValueError
    def test_invalid_range_raises(self):


        with pytest.raises(ValueError):
            int_to_roman(0)

        with pytest.raises(ValueError):
            int_to_roman(4000)

        with pytest.raises(ValueError):
            int_to_roman(-1)

        with pytest.raises(ValueError):
            int_to_roman(False)

    # input of wrong types should raise
    # TypeError
    def test_invalid_type_raises(self):

        with pytest.raises(TypeError):
           int_to_roman(None)

        with pytest.raises(TypeError):
            int_to_roman('1')

        with pytest.raises(TypeError):
            int_to_roman(1.0)

        with pytest.raises(TypeError):
            int_to_roman([1])

        with pytest.raises(TypeError):
            int_to_roman((1,))


